import React, { Component } from "react";
import GeneralInfo from "./GeneralInfo";
import Title from "./Title";

class Preview extends Component {
  render() {
    const { generalInfo, education, experience, edit } = this.props.state;
    return (
        <div>
            <Title />
            <div>{generalInfo.phone}</div>
            <GeneralInfo edit={edit} firstName={generalInfo.firstName} lastName={generalInfo.lastName} mail={generalInfo.mail} phone={generalInfo.phone}/>
        </div>
    )
  }  
}

export default Preview;
